  `fd_account_opendate` date NOT NULL DEFAULT '0000-00-00',
  `fd_account_memo` text NOT NULL,
  `fd_account_oppositecode` varchar(20) NOT NULL DEFAULT '',
  `fd_account_type` int(1) NOT NULL DEFAULT '0',
  `fd_account_isstop` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`fd_account_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gbk COMMENT='进销存账户表';

