/*Table structure for table `tb_accountglist` */

DROP TABLE IF EXISTS `tb_accountglist`;

CREATE TABLE `tb_accountglist` (
  `fd_accglist_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_accglist_no` varchar(200) DEFAULT NULL COMMENT '流水号',
  `fd_accglist_authorid` int(11) NOT NULL,
  `fd_accglist_acctype` varchar(200) DEFAULT NULL COMMENT '类型',
  `fd_accglist_inorout` varchar(255) DEFAULT NULL COMMENT '流水类型 收入或者消费',
  `fd_accglist_addmoney` double(16,2) DEFAULT NULL COMMENT '增加金额',
  `fd_accglist_lessmoney` double(16,2) DEFAULT NULL COMMENT '减少金额',
