  `fd_accglist_paymode` varchar(200) DEFAULT NULL COMMENT '交易方式 充值/转账/在线支付',
  `fd_accglist_state` varchar(100) NOT NULL DEFAULT '交易成功',
  PRIMARY KEY (`fd_accglist_id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=gbk COMMENT='账户收支流水';

