/*Table structure for table `tb_author_shaddress` */

DROP TABLE IF EXISTS `tb_author_shaddress`;

CREATE TABLE `tb_author_shaddress` (
  `fd_shaddress_id` int(12) NOT NULL AUTO_INCREMENT,
  `fd_shaddress_authorid` int(12) NOT NULL DEFAULT '0' COMMENT '会员id',
  `fd_shaddress_isuse` int(1) NOT NULL DEFAULT '0' COMMENT '是否默认',
  `fd_shaddress_shman` varchar(200) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '收货人',
  `fd_shaddress_province` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '省份编码',
  `fd_shaddress_city` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '城市编码',
  `fd_shaddress_county` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '县城编码',
  `fd_shaddress_address` varchar(200) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '地址',
  `fd_shaddress_phone` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '手机号码',
  `fd_shaddress_email` varchar(100) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '邮件',
  `fd_shaddress_postno` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '邮政编码',
  `fd_shaddress_faxno` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '传真号',
  `fd_shaddress_tel` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '电话',
  `fd_shaddress_type` varchar(20) COLLATE gbk_bin NOT NULL DEFAULT '0' COMMENT '类型',
  `fd_shaddress_town` varchar(10) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '城镇编码',
  `fd_shaddress_telcity` varchar(10) COLLATE gbk_bin NOT NULL DEFAULT '0' COMMENT '区号',
  `fd_shaddress_telno` int(11) NOT NULL DEFAULT '0' COMMENT '电话分机号',
  PRIMARY KEY (`fd_shaddress_id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=gbk COLLATE=gbk_bin COMMENT='收货地址';

/*Data for the table `tb_author_shaddress` */

/*Table structure for table `tb_authoraccount` */

