/*Table structure for table `tb_authorbkcard` */

DROP TABLE IF EXISTS `tb_authorbkcard`;

CREATE TABLE `tb_authorbkcard` (
  `fd_authorbkcard_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_authorbkcard_key` varchar(200) NOT NULL,
  `fd_authorbkcard_authorid` int(11) NOT NULL,
  `fd_authorbkcard_no` varchar(200) DEFAULT NULL COMMENT '编号',
  `fd_authorbkcard_bankid` int(11) DEFAULT NULL COMMENT '银行id',
  `fd_authorbkcard_salerid` int(11) DEFAULT NULL COMMENT '网导id',
  `fd_authorbkcard_isnew` int(11) NOT NULL DEFAULT '1' COMMENT '是否新卡',
  `fd_authorbkcard_active` int(11) NOT NULL COMMENT '银行卡状态',
  `fd_authorbkcard_activetime` datetime NOT NULL,
  `fd_authorbkcard_type` varchar(50) NOT NULL COMMENT '银行卡类型:creditcard信用卡,authorbkcard储蓄卡',
  `fd_authorbkcard_datetime` datetime DEFAULT NULL COMMENT '时间',
  `fd_authorbkcard_cardname` varchar(100) NOT NULL COMMENT '卡片名称',
  `fd_authorbkcard_ckr` varchar(20) NOT NULL COMMENT '持卡人',
  `fd_authorbkcard_creditmoney` double(12,2) NOT NULL COMMENT '信誉额度(元)',
  `fd_authorbkcard_zdr` varchar(10) NOT NULL COMMENT '账单日',
  `fd_authorbkcard_hkr` varchar(10) NOT NULL COMMENT '最后还款日',
  `fd_authorbkcard_mxq` varchar(10) NOT NULL COMMENT '免息期',
  `fd_authorbkcard_txr` varchar(10) NOT NULL COMMENT '业务提醒日',
  `fd_authorbkcard_dqr` date NOT NULL COMMENT '卡片到期日',
  `fd_authorbkcard_paycardid` int(12) NOT NULL COMMENT '绑定的刷卡器',
  `fd_authorbkcard_txphone` varchar(20) NOT NULL COMMENT '提醒手机',
  PRIMARY KEY (`fd_authorbkcard_id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=gbk COMMENT='可刷银行卡表';

/*Data for the table `tb_authorbkcard` */

