insert  into `tb_authorindustry`(`fd_auindustry_id`,`fd_auindustry_no`,`fd_auindustry_name`,`fd_auindustry_memo`) values (1,'001','测试行业','测试哦'),(2,'00001','软件行业',''),(3,'12','金融行业','理财服务'),(4,'007','贸易',''),(5,'005','其他行业',''),(6,'002','农林牧渔','农业：粮食，豆类，蔬菜及制品，水果及制品，坚果，杂果，干果，咖啡，可可及制品，棉类，麻类，含油子仁，果仁，籽，食用菌，烟草，花木，竹木，藤苇，干草，木炭，植物提取物，动物提取物，动植物油，动植物种苗，家禽，牲畜，养殖动物，蚕茧，蚕丝，羽毛，羽绒，羊绒，生皮，毛皮，动物毛鬃，肠衣，禽蛋，饲料，饲料添加剂，肥料，农药，园艺用具，农用品，农用机械，林业设备及用具，畜牧养殖业设备及用具，渔业设备及用具，粮油加工机械，饲料加工机械，屠宰及肉类初加工设备，农副产品加工，木材加工，家具制造机械，其他\r\n'),(7,'003','医药卫生','保健用品，减肥增重产品，个人保养，药材，中药饮片，康复产品，制药设备，医疗器械制造设备，计生用品，其他\r\n'),(8,'004','建筑建材','房地产，市政工程：市政道路建设，市政公用设施建设，自来水输水工程，集中供暖、供热、供气工程，文教、卫生、体育、音乐等公益设施建设，纪念性建筑设施建设，各类建筑工程，木材板材，石材石料，水泥及制品，石灰，石膏，混凝土及制品，建筑玻璃，陶瓷，搪瓷及制品，塑料建材，金属建材，防水，防潮材料，耐火，防火材料，隔热，吸声材料，绝缘材料，特种建材，施工材料，砖，瓦及砌块，墙体材料，天花板，地板，门窗，壁纸，锁具，建筑装饰五金，管件管材，厨房设施，卫浴设施，涂料，胶粘剂，作业保护，活动房，堆垛搬运机械，建筑及相关设备，陶瓷，木工机械设备，搪瓷生产加工机械，工程承包，建筑装潢设计，其他\r\n'),(9,'006','冶金矿产','金属矿产，有色金属，有色金属制品，有色金属合金，有色金属合金制品，稀土及稀土制品，黑色金属及制品，铁合金及制品，钢铁及制品，铸锻件，金属丝网，粉末冶金，磁性材料，废金属，非金属矿产，非金属矿物制品，石墨及碳素产品，矿业设备 ，冶金设备，金属线，管、板制造设备，冶炼加工，其他\r\n'),(10,'007','石油化工','1、石油及制品，煤矿，天然气，煤气矿业设备，其他石油专用机械设备2、化工：无机化工原料，有机化工原料，树脂，其他聚合物，化学纤维，食品添加剂，饲料添加剂，化学试剂，催化剂及化学助剂，日用化学品，香料，香精，染料，颜料，涂料，胶粘剂，火工产品，油墨，塑料及制品，橡胶及制品，玻璃及制品，实验室用品，仪器，仪表，塑料生产加工机械，橡胶生产加工机械，玻璃生产加工机械，化工设备，化工废料，化工产品设计加工，其他\r\n'),(11,'008','水利水电','水利、火力发电设备，水利、防洪工程及用品，河道疏浚工程，大坝、水库、闸门、泻洪工程，农田水利工程，江河、湖泊治理工程，电力工程，电力、太阳能及再生能源，其他水利水电设备，其他水利水电设施\r\n'),(12,'009','交通运输','1、轮胎，汽车：轿车，越野汽车，吉普车，卡车，载客汽车，旅行面包车，公共汽车地，微型客车，其它载客汽车，专用汽车，工程汽车，工具汽车，消防车，警车，救护车，通讯和广播用车，皮卡，洒水车，道路清扫车，垃圾车，其他专用汽车，电车，汽车配件，摩托车及配件，专用车辆，二手汽摩，汽摩附属及相关产品，停车场，加油站设备，汽车保养，交通安全，汽摩产品制造设备，船只，飞机，其他交通工具，其它；\r\n2、自行车，三轮车及配件，铁路，地铁用设备器材，船舶及配件，电梯，缆车及配件，飞行器及配件，集装箱，二手交通产品及用具，轮胎，废气处理设施，交通安全设施，运输、仓储，其他 2、机场、航空工程，港口工程，铁路工程，公路、桥梁、涵洞。\r\n'),(13,'010','信息产业','1、电脑与软件：计算机，消耗品，插卡类，主机配件，电脑外设，机箱，UPS与电源，网络设备，配件，电脑，电子记事簿，笔记本电脑，服务器，工作站，二手电脑及用品\r\n2、软件：网络工程，电脑相关用品，电脑产品制造设备，软件开发，其他\r\n3、通讯产品，通讯产品配件部件，锂电池，镍氢电池，磁卡，IP卡，IC卡，来电显示器，拨号器，充电器，天线，控制和调整设备，电话机，可视电话，移动电话，集团电话，交换机，传真机，寻呼机，对讲机，网络通信产品，通讯，声讯系统，GPS系统，通信电缆相关产品，雷达及无线导航，广电、电信设