/*Table structure for table `tb_authorlevel` */

DROP TABLE IF EXISTS `tb_authorlevel`;

CREATE TABLE `tb_authorlevel` (
  `fd_authorlevel_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_authorlevel_name` varchar(100) DEFAULT NULL COMMENT '商户等级名',
  `fd_authorlevel_no` varchar(20) DEFAULT NULL COMMENT '商户等级编号',
  `fd_authorlevel_remark` text COMMENT '商户等级备注',
  PRIMARY KEY (`fd_authorlevel_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=gbk COMMENT='商户等级';

