DROP TABLE IF EXISTS `tb_couponsale`;

CREATE TABLE `tb_couponsale` (
  `fd_couponsale_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '自增长ID',
  `fd_couponsale_no` varchar(200) NOT NULL COMMENT '购买订单号',
  `fd_couponsale_bkntno` varchar(200) DEFAULT NULL,
  `fd_couponsale_payrq` char(11) NOT NULL DEFAULT '0' COMMENT '银联交易状况 00交易完成 01 未支付 03 交易取消',
  `fd_couponsale_bkordernumber` varchar(255) NOT NULL COMMENT '银联订单号',
  `fd_couponsale_bkmoney` double(14,2) NOT NULL COMMENT '银联交易金额',
  `fd_couponsale_paycardid` int(12) NOT NULL COMMENT '刷卡器ID',
  `fd_couponsale_authorid` int(12) NOT NULL COMMENT '会员账号ID',
  `fd_couponsale_sdcrid` int(11) NOT NULL COMMENT '明盛公户id',
  `fd_couponsale_sdcrpayfeemoney` double(16,2) NOT NULL COMMENT '银联支付收取明盛手续费',
  `fd_couponsale_sdcragentfeemoney` double(16,2) NOT NULL COMMENT '资金代付收取明盛手续费',
  `fd_couponsale_couponid` int(11) DEFAULT NULL COMMENT '抵用券id',
  `fd_couponsale_couponno` varchar(20) NOT NULL COMMENT '优惠劵号',
  `fd_couponsale_paymoney` double(14,2) NOT NULL COMMENT '交易金额',
  `fd_couponsale_payfee` double(14,2) NOT NULL COMMENT '手续费',
  `fd_couponsale_payfeedirct` double(14,2) NOT NULL COMMENT '手续费收付款方还是收款方 s 收款方 f 付款方',
  `fd_couponsale_money` double(12,2) NOT NULL COMMENT '抵用劵金额',
  `fd_couponsale_creditcardno` varchar(200) DEFAULT NULL COMMENT '信用卡号',
  `fd_couponsale_creditcardbank` varchar(200) DEFAULT NULL,
  `fd_couponsale_creditcardman` varchar(200) NOT NULL,
  `fd_couponsale_creditcardphone` varchar(20) NOT NULL,
  `fd_couponsale_shoucardno` varchar(100) NOT NULL COMMENT '兑现卡号',
  `fd_couponsale_shoucardman` varchar(200) NOT NULL COMMENT '兑现人',
  `fd_couponsale_shoucardmobile` varchar(20) NOT NULL COMMENT '兑现手机号码',
  `fd_couponsale_shoucardbank` varchar(200) NOT NULL COMMENT '兑现银行',
  `fd_couponsale_datetime` datetime NOT NULL COMMENT '订单时间',
  `fd_couponsale_state` tinyint(4) NOT NULL COMMENT '订单状态',
  `fd_couponsale_rebuy` tinyint(4) NOT NULL COMMENT '优惠劵状态(0未使用，1已回购，2已使用)',
  `fd_couponsale_czman` varchar(20) NOT NULL COMMENT '操作人',
  `fd_couponsale_czdatetime` datetime NOT NULL COMMENT '操作时间',
  `fd_couponsale_memo` text NOT NULL COMMENT '审批意见',
  `fd_couponsale_isagentpay` int(11) NOT NULL COMMENT '是否已经代理支付',
  `fd_couponsale_agentdate` datetime NOT NULL COMMENT '已经代理支付时间',
  PRIMARY KEY (`fd_couponsale_id`)
) ENGINE=MyISAM AUTO_INCREMENT=703 DEFAULT CHARSET=gbk COMMENT='购买优惠劵';

