/*Table structure for table `tb_couponset` */

DROP TABLE IF EXISTS `tb_couponset`;

CREATE TABLE `tb_couponset` (
  `fd_couponset_id` int(12) NOT NULL AUTO_INCREMENT,
  `fd_couponset_fee` char(12) NOT NULL COMMENT '手续费（百分比）',
  `fd_couponset_payfeedirct` char(20) NOT NULL COMMENT '手续费支付方向',
  `fd_couponset_arriveid` int(11) DEFAULT NULL COMMENT '到账周期',
  `fd_couponset_maxfee` double(12,2) NOT NULL,
  PRIMARY KEY (`fd_couponset_id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=gbk COMMENT='优惠券兑换费率';

/*Data for the table `tb_couponset` */

insert  into `tb_couponset`(`fd_couponset_id`,`fd_couponset_fee`,`fd_couponset_payfeedirct`,`fd_couponset_arriveid`,`fd_couponset_maxfee`) values (3,'0.78%','order',1,35.00);

/*Table structure for table `tb_creditcardglist` */

DROP TABLE IF EXISTS `tb_creditcardglist`;

CREATE TABLE `tb_creditcardglist` (
  `fd_ccglist_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_ccglist_no` varchar(100) DEFAULT NULL COMMENT '流水号',
  `fd_ccglist_bkntno` varchar(200) DEFAULT NULL,
  `fd_ccglist_bkordernumber` varchar(255) NOT NULL COMMENT '银联订单号',
  `fd_ccglist_bkmoney` double(14,2) NOT NULL COMMENT '银联交易金额',
  `fd_ccglist_payrq` char(11) DEFAULT NULL COMMENT '银联交易状况 00交易完成 01 未支付 03 交易取消',
  `fd_ccglist_paytype` varchar(100) NOT NULL,
  `fd_ccglist_paycardid` int(11) DEFAULT NULL COMMENT '插卡器id',
  `fd_ccglist_authorid` int(11) DEFAULT NULL COMMENT '用户id',
  `fd_ccglist_sdcrid` int(11) NOT NULL COMMENT '明盛公户id',
  `fd_ccglist_sdcrpayfeemoney` double(16,2) NOT NULL COMMENT '银联支付收取明盛手续费',
  `fd_ccglist_sdcragentfeemoney` double(16,2) NOT NULL COMMENT '资金代付收取明盛手续费',
  `fd_ccglist_paydate` datetime DEFAULT NULL COMMENT '交易时间',
  `fd_ccglist_payfeedirct` char(10) NOT NULL COMMENT '手续费支付方向 s 收款方 f 付款方',
  `fd_ccglist_shoucardno` varchar(200) DEFAULT NULL COMMENT '还款卡号',
  `fd_ccglist_shoucardbank` varchar(200) NOT NULL COMMENT '收款银行',
  `fd_ccglist_shoucardman` varchar(200) DEFAULT NULL,
  `fd_ccglist_shoucardmobile` varchar(20) DEFAULT NULL,
  `fd_ccglist_fucardno` varchar(200) DEFAULT NULL COMMENT '付款卡号',
  `fd_ccglist_fucardbank` varchar(200) NOT NULL COMMENT '付款方开户行',
  `fd_ccglist_fucardmobile` varchar(20) DEFAULT NULL,
  `fd_ccglist_fucardman` varchar(200) DEFAULT NULL,
  `fd_ccglist_feebankid` int(11) NOT NULL,
  `fd_ccglist_current` varchar(200) DEFAULT NULL COMMENT '币种',
  `fd_ccglist_paymoney` double(14,2) DEFAULT NULL COMMENT '还款金额',
  `fd_ccglist_payfee` double(14,2) DEFAULT NULL COMMENT '手续费',
  `fd_ccglist_money` double(14,2) DEFAULT NULL COMMENT '总额',
  `fd_ccglist_arriveid` int(11) NOT NULL COMMENT '到帐周期ID',
  `fd_ccglist_arrivemode` double(14,2) NOT NULL COMMENT '到账模式',
  `fd_ccglist_arrivedate` datetime NOT NULL COMMENT '到账时间（资金代付时间）',
  `fd_ccglist_memo` text COMMENT '交易摘要',
  `fd_ccglist_qrman` varchar(200) DEFAULT NULL,
  `fd_ccglist_qrdatetime` datetime DEFAULT NULL,
  `fd_ccglist_state` int(11) DEFAULT NULL COMMENT '状态0:新增 9 完成',
  `fd_ccglist_isagentpay` int(11) NOT NULL DEFAULT '0' COMMENT '是否已经代理支付',
  `fd_ccglist_agentdate` datetime NOT NULL COMMENT '已经代理支付时间',
  PRIMARY KEY (`fd_ccglist_id`)
