/*Table structure for table `tb_creditcardset` */

DROP TABLE IF EXISTS `tb_creditcardset`;

CREATE TABLE `tb_creditcardset` (
  `fd_creditcset_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_creditcset_fee` double(14,2) DEFAULT NULL COMMENT '固定费率 固定手续费',
  `fd_creditcset_slotcardmoney` varchar(200) DEFAULT NULL COMMENT '每日刷卡金额',
  `fd_creditcset_maxmoney` varchar(200) DEFAULT NULL COMMENT '信用卡还款限额',
  `fd_creditcset_dayslotcard` int(11) DEFAULT NULL COMMENT '每日刷卡次数',
  `fd_creditcset_monthslotcard` int(11) DEFAULT NULL COMMENT '每月刷卡次数',
  `fd_creditcset_maxfee` double(11,2) DEFAULT NULL COMMENT '浮动费率 最高费率额',
  `fd_creditcset_minfee` double(11,0) DEFAULT NULL COMMENT '浮动费率 最低费率额',
  `fd_creditcset_sqfee` varchar(60) DEFAULT NULL COMMENT '浮动费率 收取费率',
  `fd_creditcset_mode` char(11) DEFAULT NULL COMMENT '类型 fix固定 per百分比',
  `fd_creditcset_payfeedirct` char(10) DEFAULT NULL COMMENT '手续费支付方向 s 收款方 f 付款方',
  `fd_creditcset_arriveid` int(11) DEFAULT NULL COMMENT '周期',
  `fd_creditcset_whenpayfee` varchar(30) DEFAULT NULL COMMENT '费率扣取节点',
  PRIMARY KEY (`fd_creditcset_id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=gbk COMMENT='信用卡还款设置';

