insert  into `tb_creditcardset`(`fd_creditcset_id`,`fd_creditcset_fee`,`fd_creditcset_slotcardmoney`,`fd_creditcset_maxmoney`,`fd_creditcset_dayslotcard`,`fd_creditcset_monthslotcard`,`fd_creditcset_maxfee`,`fd_creditcset_minfee`,`fd_creditcset_sqfee`,`fd_creditcset_mode`,`fd_creditcset_payfeedirct`,`fd_creditcset_arriveid`,`fd_creditcset_whenpayfee`) values (15,1.00,'10000','50000',5,3,0.00,0,'%','fix','f',1,'');

