/*Table structure for table `tb_manufacturer` */

DROP TABLE IF EXISTS `tb_manufacturer`;

CREATE TABLE `tb_manufacturer` (
  `fd_manu_id` int(10) NOT NULL AUTO_INCREMENT,
  `fd_manu_no` varchar(10) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '制造商编号',
  `fd_manu_allname` varchar(100) COLLATE gbk_bin DEFAULT NULL COMMENT '制造商全称',
  `fd_manu_name` varchar(20) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '制造商简称',
  `fd_manu_address` text COLLATE gbk_bin NOT NULL COMMENT '公司地址',
  `fd_manu_phone` varchar(20) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '公司电话',
  `fd_manu_fax` varchar(50) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '传真',
  `fd_manu_linkman` varchar(20) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '联系人',
  `fd_manu_manphone` varchar(20) COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '联系人电话',
  `fd_manu_workstatus` mediumint(1) NOT NULL DEFAULT '0' COMMENT '经营状况',
  `fd_manu_xingfen` varchar(50) COLLATE gbk_bin DEFAULT NULL COMMENT '所属省份',
  PRIMARY KEY (`fd_manu_id`)
) ENGINE=MyISAM AUTO_INCREMENT=422 DEFAULT CHARSET=gbk COLLATE=gbk_bin COMMENT='进销存_制造商表\r\n';

/*Data for the table `tb_manufacturer` */

insert  into `tb_manufacturer`(`fd_manu_id`,`fd_manu_no`,`fd_manu_allname`,`fd_manu_name`,`fd_manu_address`,`fd_manu_phone`,`fd_manu_fax`,`fd_manu_linkman`,`fd_manu_manphone`,`fd_manu_workstatus`,`fd_manu_xingfen`) values (421,'1122','3123','121','3','','','3123','3123',1,'21321');

/*Table structure for table `tb_member` */

DROP TABLE IF EXISTS `tb_member`;

CREATE TABLE `tb_member` (
  `fd_member_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增长ID',
  `fd_member_username` varchar(100) CHARACTER SET gbk COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '帐号',
  `fd_member_password` varchar(100) CHARACTER SET gbk COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '密码',
  `fd_member_truename` varchar(255) CHARACTER SET gbk COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '真实姓名',
  `fd_member_mobile` varchar(20) CHARACTER SET gbk COLLATE gbk_bin NOT NULL DEFAULT '' COMMENT '手机号码',
  `fd_member_email` varchar(100) DEFAULT NULL COMMENT '电子邮箱',
  `fd_member_regtime` datetime DEFAULT NULL COMMENT '注册时间',
  `fd_member_stoptime` datetime DEFAULT NULL COMMENT '注销日期',
  `fd_member_paycardid` int(11) DEFAULT NULL COMMENT '刷卡器ID',
  `fd_member_parcardbegintime` datetime DEFAULT NULL COMMENT '刷卡器开通时间',
  `fd_member_logcount` int(11) DEFAULT NULL COMMENT '使用记录',
  `fd_member_state` int(11) DEFAULT NULL COMMENT '状态 0 待审核  9审核通过  -1 注销',
  PRIMARY KEY (`fd_member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=gbk COMMENT='会员表';

/*Data for the table `tb_member` */

/*Table structure for table `tb_menu` */

DROP TABLE IF EXISTS `tb_menu`;

CREATE TABLE `tb_menu` (
  `fd_menu_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_menu_code` varchar(100) NOT NULL,
  `fd_menu_upcode` varchar(100) NOT NULL,
  `fd_menu_jpg` varchar(100) NOT NULL,
  `fd_menu_name` varchar(100) NOT NULL,
  `fd_menu_url` varchar(255) NOT NULL,
  `fd_menu_hz` varchar(255) NOT NULL,
  `fd_menu_sno` int(10) NOT NULL,
  `fd_menu_active` int(11) NOT NULL COMMENT '是否激活',
  PRIMARY KEY (`fd_menu_id`)
