CREATE TABLE `tb_mobilerechargelist` (
  `fd_mrclist_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_mrclist_no` varchar(100) DEFAULT NULL,
  `fd_mrclist_paycardid` varchar(100) DEFAULT NULL,
  `fd_mrclist_authorid` int(11) DEFAULT NULL,
  `fd_mrclist_paydate` date DEFAULT NULL,
  `fd_mrclist_bkntno` varchar(100) DEFAULT NULL,
  `fd_mrclist_bkordernumber` varchar(200) DEFAULT NULL,
  `fd_mrclist_sdcrid` int(11) DEFAULT NULL,
  `fd_mrclist_payrq` varchar(10) DEFAULT NULL,
  `fd_mrclist_paytypeid` int(11) DEFAULT NULL COMMENT '手机充值支付方式',
  `fd_mrclist_paytype` varchar(100) DEFAULT NULL COMMENT '业务类型 ',
  `fd_mrclist_rechamoney` double(12,2) DEFAULT NULL COMMENT '充值金额',
