  `fd_mrclist_mobileprov` varchar(200) DEFAULT NULL,
  `fd_mrclist_bankcardno` int(11) DEFAULT NULL,
  `fd_mrclist_bankcardbank` varchar(200) DEFAULT NULL,
  `fd_mrclist_bankcardid` int(11) DEFAULT NULL,
  `fd_mrclist_state` varchar(100) DEFAULT '0',
  `fd_mrclist_ofstate` int(11) DEFAULT NULL COMMENT '欧飞充值接口返回状态 1： 成功',
  `fd_mrclist_ofreqcontent` text COMMENT '欧飞接口请求内容',
  `fd_mrclist_ofanscontent` text COMMENT '欧飞接口返回内容',
  `fd_mrclist_date` date DEFAULT NULL,
  `fd_mrclist_datetime` datetime DEFAULT NULL,
  PRIMARY KEY (`fd_mrclist_id`)
) ENGINE=MyISAM AUTO_INCREMENT=245 DEFAULT CHARSET=gbk COMMENT='手机卡充值功能';

