/*Table structure for table `tb_order` */

DROP TABLE IF EXISTS `tb_order`;

CREATE TABLE `tb_order` (
  `fd_order_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_order_authorid` int(11) DEFAULT NULL,
  `fd_order_produreid` int(11) DEFAULT NULL,
  `fd_order_orderdate` date DEFAULT NULL,
  `fd_order_datetime` datetime DEFAULT NULL,
  `fd_order_shaddress` varchar(20) DEFAULT NULL,
  `fd_order_province` varchar(20) DEFAULT NULL,
  `fd_order_city` varchar(20) DEFAULT NULL,
  `fd_order_county` varchar(20) DEFAULT NULL,
  `fd_order_phone` varchar(20) DEFAULT NULL,
  `fd_order_bkntno` varchar(200) DEFAULT NULL,
  `fd_order_no` varchar(100) DEFAULT NULL,
  `fd_order_bkordernumber` varchar(100) DEFAULT NULL,
  `fd_order_payrq` varchar(100) DEFAULT NULL,
  `fd_order_sdcrid` int(11) DEFAULT NULL,
  `fd_order_num` double(12,2) DEFAULT NULL,
  `fd_order_price` double(12,2) DEFAULT NULL,
  `fd_order_paymoney` varchar(255) DEFAULT NULL,
  `fd_order_fucardno` int(11) DEFAULT NULL,
  `fd_order_wlno` varchar(200) DEFAULT NULL COMMENT '物流编号',
