/*Table structure for table `tb_paycard` */

DROP TABLE IF EXISTS `tb_paycard`;

CREATE TABLE `tb_paycard` (
  `fd_paycard_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_paycard_key` varchar(200) NOT NULL,
  `fd_paycard_authorid` int(11) NOT NULL,
  `fd_paycard_no` varchar(200) DEFAULT NULL COMMENT '编号',
  `fd_paycard_bankid` int(11) DEFAULT NULL COMMENT '银行id',
  `fd_paycard_salerid` int(11) DEFAULT NULL COMMENT '网导id',
  `fd_paycard_active` int(11) NOT NULL COMMENT '刷卡器状态',
  `fd_paycard_activetime` datetime NOT NULL,
  `fd_paycard_isnew` int(11) NOT NULL DEFAULT '1' COMMENT '是否为新卡',
  `fd_paycard_scope` varchar(50) NOT NULL COMMENT '刷卡器适用范围:creditcard信用卡,bankcard储蓄卡',
  `fd_paycard_paycardaccount` int(11) NOT NULL COMMENT '所属公户',
  `fd_paycard_datetime` datetime DEFAULT NULL COMMENT '时间',
  `fd_paycard_batches` varchar(100) DEFAULT NULL COMMENT '批次号',
  `fd_paycard_product` int(11) DEFAULT NULL COMMENT '商品ID',
  `fd_paycard_cusid` int(11) DEFAULT NULL COMMENT '代理商id',
  `fd_paycard_stockprice` double(14,2) DEFAULT NULL COMMENT '采购价格',
  `fd_paycard_saleprice` double(14,2) DEFAULT NULL COMMENT '销售价格',
  `fd_paycard_paycardtypeid` int(11) DEFAULT NULL COMMENT '刷卡器类型id',
  `fd_paycard_memo` text,
  `fd_paycard_posstate` int(11) DEFAULT '0' COMMENT 'POS状态,0:停用,1:警告,2:启用,3:冻结,4:销售退货处理',
  `fd_paycard_newspaydata` datetime DEFAULT NULL COMMENT '最新刷卡时间',
  `fd_paycard_cyr` varchar(20) NOT NULL COMMENT '持有人',
  `fd_paycard_cyridcard` varchar(20) NOT NULL COMMENT '持有人身份证',
  `fd_paycard_cyrmobile` varchar(20) NOT NULL COMMENT '持有人电话',
  `fd_paycard_buydate` date NOT NULL COMMENT '购买日期',
  `fd_paycard_everymoney` double(12,2) DEFAULT NULL COMMENT '每笔限额',
  `fd_paycard_everycounts` tinyint(4) DEFAULT NULL COMMENT '刷卡次数',
  `fd_paycard_neverymoney` double(12,2) DEFAULT NULL COMMENT '日额度(元)',
  `fd_paycard_nallmoney` double(12,2) DEFAULT NULL COMMENT '月额度(元)',
  `fd_paycard_state` int(11) DEFAULT NULL COMMENT '刷卡器状态:1在库存,2:销售,-1入库退货,-2销售退货',
  PRIMARY KEY (`fd_paycard_id`)
) ENGINE=MyISAM AUTO_INCREMENT=1461 DEFAULT CHARSET=gbk COMMENT='刷卡器表';

