/*Table structure for table `tb_repaymoneyglist` */

DROP TABLE IF EXISTS `tb_repaymoneyglist`;

CREATE TABLE `tb_repaymoneyglist` (
  `fd_repmglist_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_repmglist_no` varchar(100) DEFAULT NULL COMMENT '流水号',
  `fd_repmglist_bkntno` varchar(100) NOT NULL,
  `fd_repmglist_bkordernumber` varchar(255) NOT NULL COMMENT '银联订单号',
  `fd_repmglist_payrq` char(11) NOT NULL COMMENT '银联交易状况 00交易完成 01 未支付 03 交易取消',
  `fd_repmglist_paycardid` int(11) DEFAULT NULL COMMENT '插卡器id',
  `fd_repmglist_arrivedate` datetime NOT NULL COMMENT '预计支出日期',
  `fd_repmglist_authorid` int(11) DEFAULT NULL COMMENT '用户id',
  `fd_repmglist_sdcrid` int(11) NOT NULL COMMENT '明盛公户id',
  `fd_repmglist_sdcrpayfeemoney` double(16,2) NOT NULL COMMENT '银联支付收取明盛手续费',
  `fd_repmglist_sdcragentfeemoney` double(16,2) NOT NULL COMMENT '资金代付收取明盛手续费',
  `fd_repmglist_paytype` varchar(100) NOT NULL,
  `fd_repmglist_paydate` date DEFAULT NULL COMMENT '交易日期',
  `fd_repmglist_fucardno` varchar(200) DEFAULT NULL COMMENT '付款卡号',
  `fd_repmglist_fucardbank` varchar(200) DEFAULT NULL COMMENT '付款方开户行',
  `fd_repmglist_fucardmobile` varchar(100) DEFAULT NULL,
  `fd_repmglist_fucardman` varchar(100) DEFAULT NULL,
  `fd_repmglist_shoucardno` varchar(200) DEFAULT NULL COMMENT '收款卡号',
  `fd_repmglist_shoucardmobile` varchar(100) DEFAULT NULL,
  `fd_repmglist_shoucardman` varchar(100) DEFAULT NULL,
  `fd_repmglist_shoucardbank` varchar(200) DEFAULT NULL COMMENT '收款开户行',
  `fd_repmglist_current` varchar(200) DEFAULT NULL COMMENT '币种',
  `fd_repmglist_paymoney` double(14,2) DEFAULT NULL COMMENT '交易金额',
  `fd_repmglist_payfee` double(14,2) DEFAULT NULL COMMENT '手续费',
  `fd_repmglist_payfeedirct` char(10) NOT NULL COMMENT '手续费支付方向 s 收款方 f 付款方',
  `fd_repmglist_money` double(14,2) DEFAULT NULL COMMENT '总额',
  `fd_repmglist_arrivemode` double(14,2) DEFAULT NULL COMMENT '到帐模式',
  `fd_repmglist_arrivetime` date DEFAULT NULL COMMENT '到帐时间',
  `fd_repmglist_arrveid` int(11) DEFAULT NULL COMMENT '收信号码',
  `fd_repmglist_feebankid` int(11) DEFAULT NULL COMMENT '交易摘要',
  `fd_repmglist_state` int(11) DEFAULT NULL COMMENT '是否确认到帐 ok or no',
  `fd_repmglist_qrman` varchar(200) DEFAULT NULL,
  `fd_repmglist_qrdatetime` datetime DEFAULT NULL,
  `fd_repmglist_isagentpay` int(11) NOT NULL COMMENT '是否已经代理支付',
  `fd_repmglist_agentdate` datetime NOT NULL COMMENT '已经代理支付时间',
  PRIMARY KEY (`fd_repmglist_id`)
) ENGINE=MyISAM AUTO_INCREMENT=237 DEFAULT CHARSET=gbk COMMENT='信贷还款流水表';

