/*Table structure for table `tb_transfermoneyset` */

DROP TABLE IF EXISTS `tb_transfermoneyset`;

CREATE TABLE `tb_transfermoneyset` (
  `fd_transfermoneyset_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_transfermoneyset_dayslotcardcount` int(11) DEFAULT NULL COMMENT '每日刷卡转账次数',
  `fd_transfermoneyset_slotcardmoney` double(11,0) DEFAULT NULL COMMENT '每笔/每日转账金额',
  `fd_transfermoneyset_perfee` varchar(20) DEFAULT NULL COMMENT '固定费率 手续费',
  `fd_transfermoneyset_datemaxcount` int(14) DEFAULT NULL COMMENT '最高月限额',
  `fd_transfermoneyset_maxperfee` varchar(20) DEFAULT NULL COMMENT '浮动费率 最高费率额',
  `fd_transfermoneyset_minperfee` varchar(20) DEFAULT NULL COMMENT '浮动费率 最低费率额',
  `fd_transfermoneyset_sqperfee` varchar(20) DEFAULT NULL COMMENT '浮动费率 收取费比',
  `fd_transfermoneyset_mode` char(11) DEFAULT NULL COMMENT '类型 fix固定 per百分比',
  `fd_transfermoneyset_defeedirct` char(10) DEFAULT NULL COMMENT '费率扣款方向 f 代表付款方 s代表收款方',
  `fd_transfermoneyset_arriveid` int(11) DEFAULT NULL COMMENT '到账周期',
  `fd_transfermoneyset_tfmgtype` varchar(200) NOT NULL,
  PRIMARY KEY (`fd_transfermoneyset_id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=gbk COMMENT='转账汇款设置表';

/*Data for the table `tb_transfermoneyset` */

insert  into `tb_transfermoneyset`(`fd_transfermoneyset_id`,`fd_transfermoneyset_dayslotcardcount`,`fd_transfermoneyset_slotcardmoney`,`fd_transfermoneyset_perfee`,`fd_transfermoneyset_datemaxcount`,`fd_transfermoneyset_maxperfee`,`fd_transfermoneyset_minperfee`,`fd_transfermoneyset_sqperfee`,`fd_transfermoneyset_mode`,`fd_transfermoneyset_defeedirct`,`fd_transfermoneyset_arriveid`,`fd_transfermoneyset_tfmgtype`) values (13,100,5000,'',100000,'20','2','0.78%','per','f',1,'tfmg'),(14,1,5000,'',31000,'10000','2','1%','per','f',8,'suptfmg');

/*Table structure for table `tb_upload_category_list` */

DROP TABLE IF EXISTS `tb_upload_category_list`;

CREATE TABLE `tb_upload_category_list` (
  `fd_cat_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '图片ID',
