  `fd_cat_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '上传时间',
  `fd_cat_cancel` tinyint(4) NOT NULL DEFAULT '0',
  `fd_cat_display` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`fd_cat_id`)
) ENGINE=MyISAM AUTO_INCREMENT=211 DEFAULT CHARSET=gb2312 COLLATE=gb2312_bin PACK_KEYS=0 COMMENT='上传图片列表';

