/*Table structure for table `tb_version` */

DROP TABLE IF EXISTS `tb_version`;

CREATE TABLE `tb_version` (
  `fd_version_id` int(11) NOT NULL AUTO_INCREMENT,
  `fd_version_apptype` int(11) DEFAULT NULL COMMENT 'APP类型	1：android_phone 3：android_pad 2：ios_phone 4：ios_pad',
  `fd_version_no` varchar(200) DEFAULT NULL COMMENT '版本号',
  `fd_version_updatetime` datetime DEFAULT NULL COMMENT '版本更新时间',
  `fd_version_datetime` datetime DEFAULT NULL COMMENT '更新时间',
  `fd_version_isnew` int(11) DEFAULT NULL COMMENT '是否最新版本 0 非  1 最新版本',
  `fd_version_downurl` varchar(200) DEFAULT NULL,
  `fd_version_clearoldinfo` text COMMENT '清除旧的数据',
  `fd_version_newcontent` text COMMENT '更新内容',
  `fd_version_strupdate` int(11) DEFAULT NULL COMMENT '强制更新',
  PRIMARY KEY (`fd_version_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=gbk COMMENT='版本管理表';

/*Data for the table `tb_version` */

insert  into `tb_version`(`fd_version_id`,`fd_version_apptype`,`fd_version_no`,`fd_version_updatetime`,`fd_version_datetime`,`fd_version_isnew`,`fd_version_downurl`,`fd_version_clearoldinfo`,`fd_version_newcontent`,`fd_version_strupdate`) values (1,1,'1.0.0','2013-10-22 16:55:26','2013-11-13 22:38:43',1,'http://www.ms56.net/wap/msmobilepay.apk','0','1，进行终端容错处理\r\n2，优化刷卡器验证提示\r\n3，版本号3.4\r\n4. 优化信用卡还款第二个界面刷卡成功不高的问题\r\n5.主界面功能菜单调整',1),(2,2,'1.0.0','2013-08-30 00:00:00','2013-11-13 17:46:11',1,'https://itunes.apple.com/us/app/tong-fu-bao-qian-bao/id740276926?ls=1@mt=8','0','1，版本：1.0.0\r\n2，解决上传中文是乱码的问题\r\n3，解决反馈少于十个字也能提交的问题\r\n4，解决快递查询详情用列表显示问题\r\n5，解决密码修改可以输入除数字和字母以外的问题',0);

/*Table structure for table `tb_warnlevel` */

