  PRIMARY KEY (`fd_warnlevel_id`),
  UNIQUE KEY `fd_warnlevel_id` (`fd_warnlevel_id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=gbk COMMENT='POS预警级别';

